#!/usr/bin/env python3

# f = "dabAcCaCBAcCcaDA"
f_original = ""
def collapse(s1):
    i = 0
    changed = True
    while (changed):
        changed = False
        try:
            while i < len(s1):
                if (s1[i].lower() == s1[i + 1].lower()) and ((s1[i].isupper() and s1[i + 1].islower()) or (s1[i].islower() and s1[i + 1].isupper())):
                    s1 = s1.replace(s1[i] + s1[i + 1], "", 1)
                    changed = True
                else:
                    i = i + 1
        except IndexError:
            if changed == True:
                i = 0
                continue
    return len(s1)

if __name__=='__main__':
    import string
    import copy
    f_lower = f_original.lower()
    to_check = []
    for letter in list(string.ascii_lowercase):
        if letter in f_lower:
            to_check.append(letter)

    lengths = {}
    print(to_check)
    for letter in to_check:
        f = copy.deepcopy(f_original)
        f = f.replace(letter,"")
        f = f.replace(letter.upper(),"")
        lengths[letter] = collapse(f)

    print(min(lengths.values()))